import React from 'react';
import { useSecret } from './SecretContext';

const secrets = [
  { id: 1, text: 'La raison de la folie de AM' },
];

const Secret = () => {
  const { revelSecret } = useSecret();

  return (
    <div className="container">
      <h1>Secrets</h1>
      <ul className="list-group">
        {secrets.map((secret) => (
          <li key={secret.id} className="list-group-item d-flex justify-content-between align-items-center">
            {secret.text}
            <input
              type="checkbox"
              checked={revelSecret}
              readOnly
            />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Secret;
